  // Function to check if a point is inside a polygon
  function isPointInPolygon(point, polygon) {
    var x = point[0], y = point[1];
    var inside = false;
    for (var i = 0, j = polygon.length - 1; i < polygon.length; j = i++) {
        var xi = polygon[i][0], yi = polygon[i][1];
        var xj = polygon[j][0], yj = polygon[j][1];
        var intersect = ((yi > y) != (yj > y)) &&
            (x < (xj - xi) * (y - yi) / (yj - yi) + xi);
        if (intersect) inside = !inside;
    }
    return inside;
}

// Function to generate a random point within the given polygon boundaries
function randomPointInPolygon(polygon) {
    var minX = polygon[0][0];
    var maxX = polygon[0][0];
    var minY = polygon[0][1];
    var maxY = polygon[0][1];
    for (var i = 1; i < polygon.length; i++) {
        minX = Math.min(minX, polygon[i][0]);
        maxX = Math.max(maxX, polygon[i][0]);
        minY = Math.min(minY, polygon[i][1]);
        maxY = Math.max(maxY, polygon[i][1]);
    }
    var point;
    do {
        point = [
            Math.random() * (maxX - minX) + minX,
            Math.random() * (maxY - minY) + minY
        ];
    } while (!isPointInPolygon(point, polygon));
    return point;
}


